import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Open the cart modal (try clicking the cart div with text "Cart" or class "cart")
    // Use text selector as first strategy
    const cartDiv = await page.waitForSelector('xpath=//div[contains(@class,"cart") and contains(text(),"Cart")]', { timeout: 5000 });
    await cartDiv.click();

    // Wait for the cart modal to appear (look for a heading or cart item)
    // Try to find the cart modal by heading "Your cart" or cart item class
    // Wait for any element with class 'cart-item' (cart is not empty)
    await page.waitForSelector('.cart-item, .empty-cart', { timeout: 5000 });

    // Take screenshot after opening cart
    const step2 = path.join(screenshotsDir, 'step_2_cart_opened.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Check if cart is empty
    const isEmpty = await page.$('.empty-cart');
    let removedTitle = null;

    if (!isEmpty) {
      // There is at least one cart item
      // Find the first cart item and its title for verification
      const cartItem = await page.waitForSelector('.cart-item', { timeout: 5000 });
      const titleEl = await cartItem.$('.cart-item-title');
      removedTitle = titleEl ? (await titleEl.textContent()).trim() : null;

      // Find and click the "Remove" button inside this cart item
      const removeBtn = await cartItem.$('button.remove-item');
      if (removeBtn) {
        await removeBtn.click();
      } else {
        throw new Error('Remove button not found in cart item');
      }

      // Wait for the cart to update (either cart becomes empty or item disappears)
      await page.waitForTimeout(500); // Small pause for UI update
      // Wait for either the cart item to disappear or for .empty-cart to appear
      await Promise.race([
        cartItem.waitForElementState('detached', { timeout: 3000 }),
        page.waitForSelector('.empty-cart', { timeout: 3000 })
      ]);
    }

    // Take screenshot after removal
    const step3 = path.join(screenshotsDir, 'step_3_item_removed.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract cart state after removal
    const cartItemsCount = await page.$$eval('.cart-item', els => els.length);
    const cartEmptyText = await page.$eval('.empty-cart', el => el.textContent).catch(() => null);

    return {
      success: true,
      action: "Removed first item from cart (if present) and verified cart state",
      extractedData: {
        removedTitle,
        cartItemsCount,
        cartEmptyText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
